pragma solidity ^0.4.23;

contract Asset {

    address owner;

    address allowed;

    string name;

    uint rock;
    uint paper;
    uint scissors;

    constructor(string _name, uint _rock, uint _paper, uint _scissors) public {
        owner = msg.sender;
        name = _name;
        rock = _rock;
        paper = _paper;
        scissors = _scissors;

    }

    function allowTransfer(address a) public {
        require(msg.sender == owner, "Only owner");
        require(a != owner, "You already own this asset");
        allowed = a;
    }

    function transfer(address a) public {
        require(msg.sender == owner || msg.sender == allowed, "Can't transfer");

        owner = a;
        allowed = address(0);
    }

    function getRock() public view returns (uint) {
        return rock;
    }

    function getPaper() public view returns (uint) {
        return paper;
    }

    function getScissors() public view returns (uint) {
        return scissors;
    }

    function getName() public view returns (string) {
        return name;
    }
}
